    false,nt"url": null,nt"notes": "This narrative report for Squaw Creek National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1957.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and wildfires during this period. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, raptors, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include haying and fur harvesting. A progress report on field
    investigations and applied research is included. The public relations section of
    the report describes recreational uses, Refuge visitors, Refuge participation, and
    violations. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
